// Ensure all images have accessible alt text: add descriptive alts for known team photos and mark others decorative if missing
document.addEventListener('DOMContentLoaded', () => {
  try {
    const images = Array.from(document.getElementsByTagName('img'));
    images.forEach(img => {
      if (img.hasAttribute('alt') && img.getAttribute('alt').trim() !== '') return;
      const src = (img.getAttribute('src') || '').toLowerCase();
      if (src.includes('mitra_martin')) {
        img.setAttribute('alt', 'Mitra Martin  community learning designer');
      } else if (src.includes('san_naidoo')) {
        img.setAttribute('alt', 'San Naidoo  co-founder and organisational designer');
      } else if (src.includes('context_institute_logo') || src.includes('seeds_dao_logo') || src.includes('openart')) {
        // logos: provide descriptive alt
        const name = src.split('/').pop().replace(/\.(png|jpg|jpeg|svg)$/, '').replace(/[_-]/g,' ');
        img.setAttribute('alt', name.split('.').join(' '));
      } else {
        // decorative images should be ignored by assistive tech
        img.setAttribute('alt', '');
      }
    });
  } catch (e) {
    console.error('Error ensuring image alts:', e);
  }
});
/* Accessibility fixes: ensure FAQ buttons have IDs and answers reference them (aria-labelledby),
   and make skip-link visible when focused via class toggling for older browsers. */
document.addEventListener('DOMContentLoaded', () => {
  try {
    // Ensure FAQ buttons have stable ids and answers reference them
    const faqButtons = Array.from(document.querySelectorAll('.faq-question'));
    faqButtons.forEach((btn, idx) => {
      if (!btn.id) btn.id = `faq-btn-${idx+1}`;
      const controls = btn.getAttribute('aria-controls');
      if (controls) {
        const answer = document.getElementById(controls);
        if (answer && (!answer.getAttribute('aria-labelledby') || answer.getAttribute('aria-labelledby').trim()==='')) {
          answer.setAttribute('aria-labelledby', btn.id);
        }
      }
    });

    // Make skip-link visible on focus for browsers that don't support :focus-visible
    const skip = document.querySelector('.skip-link');
    if (skip) {
      skip.addEventListener('keydown', (e) => {
        if (e.key === 'Enter' || e.key === ' ' ) {
          const target = document.getElementById('main-content') || document.querySelector('main');
          if (target) {
            e.preventDefault();
            target.setAttribute('tabindex','-1');
            target.focus();
            target.removeAttribute('tabindex');
          }
        }
      });
      // Ensure skip-link becomes visible when focused (redundant with CSS but helpful)
      skip.addEventListener('focus', () => skip.classList.remove('sr-only'));
      skip.addEventListener('blur', () => skip.classList.add('sr-only'));
    }

    // Validate interactive ARIA attributes on nav toggle
    const navToggle = document.querySelector('.nav__toggle');
    const primaryMenu = document.getElementById('primary-menu');
    if (navToggle && primaryMenu) {
      if (!navToggle.hasAttribute('aria-controls')) navToggle.setAttribute('aria-controls', primaryMenu.id || 'primary-menu');
      if (!primaryMenu.id) primaryMenu.id = 'primary-menu';
    }
  } catch (err) {
    console.error('Accessibility script error:', err);
  }
});
